function formSubmit(e){e.preventDefault(),""!==document.getElementById("redis-addr").value&&fetch("http://localhost:8080/scan/"+document.getElementById("redis-addr").value,{method:"POST",headers:{"Content-Type":"application/json","X-CSRF":document.getElementById("_csrf").value}}).then(e=>e.json()).then(e=>{let t=document.getElementById("redis-report-wrapper");t.classList.add("show"),t.classList.remove("hide")})}function fetchCsrf(){fetch("http://localhost:8080/csrf",{method:"GET"}).then(e=>e.json()).then(e=>document.getElementById("_csrf").value=e.token)}function attachFormSubmitEvent(e){fetchCsrf(),document.getElementById(e).addEventListener("submit",formSubmit)}document.addEventListener("DOMContentLoaded",function(e){attachFormSubmitEvent("redis-search")},{once:!0});
